import React from "react";
import { FaFacebookF, FaLinkedinIn, FaTwitter } from "react-icons/fa";

let teamData = [
  {
    images: "01",
    name: "Brigadier(Retd) Sajjad Sardar ",
    title: "Core Member",
    designation: "Space Scientist",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "02",
    name: "Syed Wajahat Hussain",
    title: "Core Member",
    designation:
      "An engineer with experience of over thirty years in Product Development, International Trade",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
    ],
  },
  {
    images: "03",
    name: "Dr Akhtar Hussain",
    title: "Core Member",
    designation:
      "Over twenty five years of experience in Software Suite development as well as Geographic Information System.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "04",
    name: "Syed Muhammad Abbas",
    title: "Core Member",
    designation:
      "A business executive with experience in Economics and Business Management having expertise in Business Mapping and Ergonomics",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
];

// into TeamOne
let advisors = [
  {
    images: "01",
    name: "Brigadier(Retd) Sajjad Sardar ",
    title: "Core Member",
    designation: "Space Scientist",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "02",
    name: "Syed Wajahat Hussain",
    title: "Core Member",
    designation:
      "An engineer with experience of over thirty years in Product Development, International Trade",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
    ],
  },
  {
    images: "03",
    name: "Dr Akhtar Hussain",
    title: "Core Member",
    designation:
      "Over twenty five years of experience in Software Suite development as well as Geographic Information System.",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "04",
    name: "Syed Muhammad Abbas",
    title: "Core Member",
    designation:
      "A business executive with experience in Economics and Business Management having expertise in Business Mapping and Ergonomics",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
];

// into TeamOne
export default teamData;
